import React from "react";
import ReactDOM from "react-dom";
import Heading from "./Heading";
import Para from "./Para";

ReactDOM.render(
    <>
    <Heading/>
    <Para/>
    <ol>
        <li>Apple</li>
        <li>Mango</li>
        <li>Orange</li>
        <li>Litchi</li>
    </ol>

    </>,
    document.getElementById("root")
);
